        "title": "Vintage Airstream Suite on Top of a Hill",
        "description": "Camper and Cabin prides itself as the first Airstream accommodation in the Philippines. With its seamless blend of thoughtful design and its location's natural surroundings, one can enjoy the spirit of camping while embracing the comforts of a luxury hotel.\nThe space\nThe 25 footer Airstream invokes a Boho chic vibe. With its crisp white beddings and modern furnishings, this road trip inspired accommodation brings comfort touches from home.\n\nThe space features the following:\n\n*Queen size bed with plush hotel quality pillows and linens\n* Small dining area\n* Couch that could double as beds\n* Kitchenette (induction coffee maker, microwave, pots and pans, utensils, dinnerware, etc)\n* Underground T&B\n* Eco-friendly bath amenities\n* Flat TV (with local channels and movies saved on USB)\n* Bluetooth speaker\n* Air conditioning unit\n* Private deck/outdoor dining/grilling area\nOther things to note\n1) WE DO NOT ALLOW PHOTO/VIDEO SHOOTS, PRODUCT SHOOTS AND EVENTS IN THE PROPERTY.\n\n2) When it gets rainy and windy, the airstream could move and wiggle. While this may scare off the faint-hearted, we assure our guests that the airstream is strongly anchored on the ground. Before booking, guests should be ready for such scenario especially during rainy season.\n\n3) We require a security deposit of 5,000 upon check in of guests. This may be given in cash or through GCash. The amount shall be returned to guests upon check out provided that the keys are returned to the staff and there's no missing/broken items in the property.\n\n4) We can arrange for hiking trips to Mount Batulao. We can refer you to experienced locals who facilitates hiking trips for tourists (subject to LGU rules on allowing hikers in Batulao)\n\n5) We require saliva antigen test onsite for 500/pax. Kids are exempted.\n",
