        "title": "Luxurious Cabin Villa in Deep Nature",
        "description": "A beautiful cabin villa that sits amidst the serene ambience of Nandi Valley and the surrounding foothills. With its lush green forest cover and dense greenery all around, this unique Pre-engineered cabin Haus can play host to small family gatherings, weekend getaways and a peaceful homestay experience with authentic food available as add-on. Equipped with luxurious rooms, spacious sit outs, meditative garden spaces and a view to kill for - from the open air balcony and patio.\nThe space\nZero% human interaction supporting social distancing. Witness the renown Nandi Hills sunrise view by stepping in the balcony of the your room. Experience the serene sunset beauty with 360 degree view from terrace. Irresistible trekking track which is situated at 2 mins distance from the Villa.\nGuest access\nGuest is privileged to have access to the entire Villa with utmost privacy. The Villa will be handed over to you with pristine state and we request you to handover it in the same manner. A sit-out area for the parents adjacent to lawn for kids to play around which give an ease for all to be comfortable.\nOther things to note\nThere will be minimal cleaning charges during check out. 24 hours running kitchen with Breakfast Lunch Evening snacks and Dinner being available on paid basis. Kitchen is accessible to guests for special cases like infant food, Chef can support if required.\nNo loud music allowed as the place is surrounded by hills and valley which is prone to ECHO.\n",
