        "title": "Riverside Glamping in a Geodesic Dome near Bhimtal",
        "description": "The sound of the Kalsa is a constant companion during your stay in our unique Dome Tents at the Glamping Tales Campsite. Morning walks exploring nearby trails, lazy afternoons by the riverside and evenings spent swapping stories at the fire pit make for a regular day here with furry and feathered friends over for company. Located 15km from Bhimtal, at a tiny village Tada, it is a 45min drive with the last 5km in poor condition. We are a small camp with 5 tents pitched in a natural landscape.\nThe space\nOur camp is a small oasis surrounded by nature. We have the river flowing by and forest on 3 sides. We have operational local farms in the village adjacent to us and guests can experience farm activities as well. We have 2 Geodesic Dome Tents and 3 Swiss Cottage Tents fairly secluded from one another and we have a small cafe where we prepare fresh wholesome meals for our guests. Overall a space to relax and unwind away from city life.\nGuest access\nGuests can access the open sit out spaces, the cafe and the fire pit areas.\nOther things to note\nThe last 5km of road to the camp is in poor condition. We suggest guests avoid vehicles with very low ground clearance.\nThe camp is approx a 150mtr walk down a rough path from the road where the vehicle will need to be parked. We request guests to carry shoes since the area is quite rocky being a riverside location.",
