        "description": "Welcome to Villa infinity in Patong. One of the most luxury villa in Patong.\n\nFeatures of Villa infinity\n*Huge villa with much space\n*Big private pool\n*10 bedrooms ensuite with 10 bathrooms\n*Highspeed Wifi\n*Hot and cold Jacuzzi\n*Panoramic views over Patong Beach\n*Full equipment kitchen\n*Full equipment private gym\n*Roof deck with lounge\n*BBQ\n*Office with chair\n*Pool sala lounge\n*Cinema room\n*Privat Parking\n*Night guard\n*Great location few minutes by car to Beach, Bangla Road and Shopping malls\nThe space\nLooking for a luxury Villa in Patong Beach area?\nVilla infinity is one of the most luxury villa you can find with everything you need for a\nperfect time in Phuket.\nA lot space for you and your group in one of the best location in Patong.\nPictures saying more than 1000 words. If you have any questions me and my team are always available for you.\n\nNo hidden costs:\nFree electric\nFree water\nFree Wi-Fi\n\nNo hidden costs:\nFree electric\nFree Wi-Fi\nFree daily cleaning\n\nExtra costs: No extra cost you pay only one time in Airbnb.\n\nCleaning during your stay:\nWe will send you once a day housekeeper you can choose between 9 am - 12 noon or 3 pm (15:00) - 6 pm (18:00)\n\nPlease note: One of our neighbors started do constructions. Therefore it can be noisy. This is beyond of my control. Construction should completed by October 2023. If you noise sensitive please don't book this villa. Due the construction the rates are lower than usual. Thanks for your understanding\nOther things to note\nplease always add the correct number of guests then Airbnb will show you the correct price. After 10 guests the price per pax and night is 2000 thai baht per night and pax. If you more than 16 guests we will send by host offer the correct price because Airbnb system only allows up to 16 people to add.\n\n\n\nOne CCTV located by the gate. It will be on 24/7.\n",
